import React, { useState } from 'react'
import useClipboard from '@/@core/hooks/useClipboard'

const Tab7 = () => {
  const [copied, setCopy] = useState(false)
  const clipboard = useClipboard()
  const codeToCopy = () => {
    return ` <!DOCTYPE html>
    <html>
      <head>
        <title>HTML Meta Tag</title>
        <meta http-equiv = "refresh" content = "1; url = YOUR WEBSITE URL HERE" />
      </head>
      <body>
      <p>YOUR WEBSITE DESCRIPTION HERE </p>
      </body>
    </html> `
  }
  const handleClick = () => {
    clipboard.copy(codeToCopy())
    setCopy(true)

    setTimeout(() => {
      setCopy(false)
    }, 2000)
  }

  return (
    <>
      <p style={{ fontSize: '30px' }}>
        <strong>웹사이트 구축방법</strong>
      </p>
      <p
        style={{
          width: 'fit-content',
          padding: '5px 10px',
          borderRadius: '15px',
          color: '#fff',
          backgroundColor: '#698BEF'
        }}
      >
        Step 1. Pinata에 업로드하기
      </p>
      <p style={{ textAlign: 'center' }}>
        <img
          style={{ border: '0.5px solid #bebebe' }}
          src='data:image/png;base64,'
        />
      </p>
      <p>
        Pinata(https://pinata.cloud)는 IPFS 네트워크에서 파일을 호스트할 수 있는 고정 서비스입니다. Pinata에서
        회원가입/로그인한 후, 좌측 메뉴에서 ‘Pin Manager’가 선택되었는지 확인합니다. 우측 화면에서 ‘업로드’를 클릭하면
        찾아보기 창이 나타납니다. 업로드하려는 웹사이트 파일이 포함된 폴더를 찾아 선택합니다. 폴더 내의 홈페이지는
        IPFS용 index.html로 이름을 지정해야 합니다.
      </p>
      <p style={{ textAlign: 'center' }}>
        <img
          style={{ border: '0.5px solid #bebebe' }}
          src='data:image/png;base64,'
        />
      </p>
      <p>
        업로드가 완료되면 IPFS CID(또는 IPFS 해시)가 ‘My Pins’ 탭 아래에 표시됩니다. IPFS 해시를 클릭하여 클립보드에
        복사합니다.
      </p>
      <p
        style={{
          width: 'fit-content',
          padding: '5px 10px',
          borderRadius: '15px',
          color: '#fff',
          backgroundColor: '#698BEF',
          marginTop: 50
        }}
      >
        Step 2. 웹사이트 구축하기
      </p>
      <p>
        Unstoppable Domains의 내 도메인에서 적용을 희망하는 Web3 도메인의 ‘Manage’를 클릭합니다. 좌측 메뉴에서
        웹사이트를 클릭하고, 우측 화면에서 ‘사용자 지정 웹사이트 링크’를 선택합니다. 이후 IPFS 해시를 붙여 넣고 맨
        아래에 있는 ‘변경 사항 확인(Confirm Changes)’을 클릭해야 변경사항이 저장됩니다.
      </p>
      <p
        style={{
          width: 'fit-content',
          padding: '5px 10px',
          borderRadius: '15px',
          color: '#fff',
          backgroundColor: '#698BEF',
          marginTop: 50
        }}
      >
        Step 3. 내 도메인 테스트 하기
      </p>
      <p>
        내 도메인과 연결되어 있는 메타마스크로 트랜젝션하기 위해 서명합니다. 트랜젝션이 완료가 되면 Unstoppable 확장
        프로그램을 다운로드합니다. 확장 프로그램을 활성화시킨 다음에 내 도메인을 브라우저 주소창에 입력하여 제대로
        작동되는지 테스트합니다.
      </p>
      <p style={{ fontSize: '30px', fontWeight: 'bold' }}>4. 기존 도메인으로 리디렉션</p>
      <p
        style={{
          width: 'fit-content',
          padding: '5px 10px',
          borderRadius: '15px',
          color: '#fff',
          backgroundColor: '#698BEF',
          marginTop: 50
        }}
      >
        Step 1. 리디렉션 설정하기
      </p>
      <p>
        기존 도메인으로 리디렉션하기 위해 사용자가 직접 Web3 도메인에서 index.html을 통해 리디렉션을 수행해야 합니다.
      </p>
      <p style={{ textAlign: 'center', display: 'none' }}>
        <img
          style={{ border: '0.5px solid #bebebe' }}
          src='data:image/png;base64,'
        />
      </p>
      <p>PC에서 텍스트 편집 소프트웨어(예: Window용 메모장 또는 Mac용 TextEdit)를 열고 다음 코드를 붙여 넣습니다.</p>
      <pre
        style={{
          background: 'rgba(0, 0, 0, .1)',
          maxWidth: 945,
          padding: '1rem',
          margin: 'auto',
          whiteSpace: 'pre-wrap',
          position: 'relative'
        }}
      >
        <div>
          <p>&lt;!DOCTYPE html&gt;</p>
          <p>&lt;html&gt;</p>
          <p> &lt;head&gt;</p>
          <p> &lt;title&gt;HTML Meta Tag&lt;/title&gt;</p>
          <p> &lt;meta http-equiv = "refresh" content = "1; url = YOUR WEBSITE URL HERE" /&gt;</p>
          <p> &lt;/head&gt;</p>
          <p> &lt;body&gt;</p>
          <p> &lt;p&gt;YOUR WEBSITE DESCRIPTION HERE &lt;/p&gt;</p>
          <p> &lt;/body&gt;</p>
          <p>&lt;/html&gt;</p>
        </div>
        <button
          onClick={handleClick}
          style={{
            lineHeight: '22px',
            border: '1px solid transparent',
            borderRadius: 100,
            background: '#3e7a38',
            color: '#fff',
            minWidth: '7.5rem',
            fontWeight: 700,
            position: 'absolute',
            right: '15px',
            bottom: '15px',
            cursor: 'pointer',
            textTransform: 'uppercase'
          }}
        >
          {copied ? 'copied' : 'copy'}
        </button>
      </pre>
      <p>“YOUR WEBSITE DESCRIPTION HERE”를 자신의 URL로 바꾸고(https:// 를 포함), 파일을 index.html로 저장합니다.</p>
      <p>
        ※ Mac OS의 TextEdit 사용자는 환경 설정에서 Rich Text 대신 Plain Text를 선택해야 합니다. 변경 사항 적용을 위해
        해당 애플리케이션을 재시작합니다.
      </p>
      <p
        style={{
          width: 'fit-content',
          padding: '5px 10px',
          borderRadius: '15px',
          color: '#fff',
          backgroundColor: '#698BEF',
          marginTop: 50
        }}
      >
        Step 2. 웹사이트 구축하기
      </p>
      <p>
        Unstoppable Domains의 내 도메인에서 적용을 희망하는 Web3 도메인의 ‘Manage’를 클릭합니다. 좌측 메뉴에서
        웹사이트를 클릭하고, 우측 화면에서 ‘IPFS에 파일 업로드’를 선택합니다. 이후 업로드를 클릭 후, 찾아보기 창에서
        index.html 폴더를 찾아 확인합니다. 아래에 있는 ‘웹사이트 시작’을 클릭합니다.
      </p>
    </>
  )
}

export default Tab7
